('2010-07-09 15:36:36', '2010-07-09 15:36:36', 75, 'We are giving %s%s in %s Bucks for every friend you refer when they make their first purchase. It is our way of saying \\"thanks\\" for spreading the word and increasing our collective buying power! %s Bucks can be used toward any %s purchase, and they never expire.', '我々は、％で语ときに彼らが最初に購入する参照してくださいすべての友人のためにバックスを％sの％を与えている。これは&quot;という言葉を広め、私たちの集団購買力を高めるための\\&quot;のおかげで\\を言って私たちの方法です！ ％は、バックスは、任意の％に向かって使用することができますのは、購入だと、彼らは無期限。', 1, 1),
('2010-07-09 15:36:36', '2010-07-09 15:36:36', 75, 'We''ll take you to Google where you''ll be asked to let %s take a peek at your address book. Once you get there, click \\"Grant access\\" and you''ll be returned here to find your friends.', '我々は、Googleあなたは％があなたのアドレス帳を覗いて見てみましょうするよう求められますに連れて行くよ。したら、そこには、[\\&quot;アクセスを許可する\\&quot;とここでお友達を見つけるために返されるでしょう。', 1, 1),
('2010-07-09 15:36:36', '2010-07-09 15:36:36', 75, 'We''ll take you to Windows Live where you''ll be asked to let %s take a peek at your address book. Once you get there, click \\"Grant access\\" and you''ll be returned here to find your friends.', '我々は、Windows Liveにどこで％があなたのアドレス帳を覗いて見てみましょうするよう求められます場合をお願いします。したら、そこには、[\\&quot;アクセスを許可する\\&quot;とここでお友達を見つけるために返されるでしょう。', 1, 1),
('2010-07-09 15:36:36', '2010-07-09 15:36:36', 75, 'We''ll take you to Yahoo! where you''ll be asked to let %s take a peek at your address book. Once you get there, click \\"Grant access\\" and you''ll be returned here to find your friends.', '我々は、ヤフーに連れて行くよ！どこで％があなたのアドレス帳を覗いて見てみましょうするよう求められます。したら、そこには、[\\&quot;アクセスを許可する\\&quot;とここでお友達を見つけるために返されるでしょう。', 1, 1),
